import jsPDF from 'jspdf';
import Cookies from 'js-cookie';

function PdfGenerator(profileData, painpointsData, overallPerceptionRating) {
  var profileIcon =
    'data:image/jpeg;base64,';

  var overallPerceptionRatingIcons1 =
    'data:image/jpeg;base64,';

  var overallPerceptionRatingIcons2 =
    'data:image/jpeg;base64,';

  var overallPerceptionRatingIcons3 =
    'data:image/jpeg;base64,';

  var overallPerceptionRatingIcons4 =
    'data:image/jpeg;base64,';

  var overallPerceptionRatingIcons5 =
    'data:image/jpeg;base64,';

  var locationIcon =
    '';

  var busIcon =
    'data:image/jpeg;base64,';

  var wifiIcon =
    '';

  var licenseIcon =
    '';

  var cgIcon =
    'data:image/jpeg;base64,';

  function getSmiley(value) {
    switch (value) {
      case 0:
        return 'data:image/jpeg;base64,';
      case 1:
        return 'data:image/jpeg;base64,';
      case 2:
        return 'data:image/jpeg;base64,';
      case 3:
        return 'data:image/jpeg;base64,';
      case 4:
        return 'data:image/jpeg;base64,';
      default:
        return '';
    }
  }

  var d = new Date();

  var date = d.getDate();
  var month = d.getMonth() + 1; // Since getMonth() returns month from 0-11 not 1-12
  var year = d.getFullYear();

  var dateStr = date + '/' + month + '/' + year;
  var pageCounter = 1;

  function addNewPage() {
    doc.addPage();
    pageCounter++;
    doc.setFontSize(12);
    doc.setFont('Verdana');
    doc.setTextColor(121, 121, 121);
    doc.text(70, 70, profileData.project.name);
    doc.setTextColor(0, 0, 0);
    doc.setFontSize(18);
    doc.text(500 / 2, 70, Cookies.get('client'));
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(12);
    doc.setFont('Verdana');
    doc.text(465, 70, dateStr);
    doc.addImage(cgIcon, 'JPEG', 70, 760, 270, 70);
    doc.text(515, 780, pageCounter.toString());
    y = 100;
    var pageHeight = 840;
    var secondBoxHeight = pageHeight - y - 100;
    doc.setDrawColor(188, 188, 188);
    doc.rect(70, y, 450, secondBoxHeight);
    y = 125;
    return y;
  }

  var doc = new jsPDF('p', 'pt', 'a4', true);

  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.setTextColor(121, 121, 121);
  doc.text(70, 70, profileData.project.name);
  doc.setTextColor(0, 0, 0);
  doc.setFontSize(18);
  doc.text(500 / 2, 70, Cookies.get('client'));
  doc.setTextColor(121, 121, 121);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.text(465, 70, dateStr);
  doc.addImage(cgIcon, 'JPEG', 70, 760, 270, 70);
  doc.text(515, 780, pageCounter.toString());
  //Name
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(180, 125, 'Name');
  doc.setTextColor(121, 121, 121);
  doc.setFont('Verdana');
  doc.setFontSize(13);
  doc.text(180, 145, profileData.profile_name);
  //Job role
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(180, 170, 'User Role');
  doc.setTextColor(121, 121, 121);
  doc.setFont('Verdana');
  doc.setFontSize(13);
  var role = profileData.persona_job_role.job_role;
  var roleLines = doc.splitTextToSize(role, 150);
  doc.text(180, 190, roleLines);

  //Employees
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(350, 125, 'No. Of Employees in Role');
  doc.setTextColor(121, 121, 121);
  doc.setFont('Verdana');
  doc.setFontSize(12);
  doc.text(350, 145, profileData.number_of_employees_in_role.toString());
  //Typical Grades
  var grades = '';
  for (var i = 0; i < profileData.grades.length; i++) {
    if (i === profileData.grades.length - 1) {
      grades += profileData.grades[i].grade_title;
    } else grades += profileData.grades[i].grade_title + '-';
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(350, 170, 'Typical Grades');
  doc.setTextColor(121, 121, 121);
  doc.setFont('Verdana');
  doc.setFontSize(12);
  doc.text(350, 190, grades);
  var y = 100;
  var width = y;
  if (roleLines.length > 0) {
    doc.setDrawColor(188, 188, 188);
    width = y + roleLines.length * 13;
    doc.rect(70, y, 450, width);
  } else {
    doc.setDrawColor(188, 188, 188);
    doc.rect(70, y, 450, 110);
  }
  //Profile icon
  doc.addImage(profileIcon, 'JPEG', 85, (y + width + 30) / 2, 70, 70);

  y = width + 110;
  //2nd Box
  var pageHeight = 840;
  var secondBoxHeight = pageHeight - y - 100;

  doc.setDrawColor(188, 188, 188);
  doc.rect(70, y, 450, secondBoxHeight);
  doc.line(70, y + 35, 520, y + 35);
  doc.setTextColor(23, 105, 170);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.setFontType('bold');
  doc.text(100, y + 22, 'General');
  doc.setDrawColor(23, 105, 170);
  doc.setLineWidth(1);
  doc.line(70, y + 35, 180, y + 35);

  doc.setTextColor(188, 188, 188);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.text(200, y + 22, 'Perception And Opportunities');

  doc.setTextColor(188, 188, 188);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.text(390, y + 22, 'Persona Summary');
  y = y + 60;
  doc.setFontType('normal');
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, y, 'Background');
  var backgroundContent = profileData.background;
  var backgroundContentLines = doc.splitTextToSize(backgroundContent, 410);
  doc.setTextColor(121, 121, 121);
  doc.setFont('Verdana');
  doc.setFontSize(10);
  for (i = 0; i < backgroundContentLines.length; i++) {
    doc.setTextColor(121, 121, 121);
    doc.setFont('Verdana');
    doc.setFontSize(10);
    doc.text(90, y + 15, backgroundContentLines[i]);
    if (y >= 700) {
      y = addNewPage();
    } else {
      y += 15;
    }
  }

  //primary skills
  y = y + 20;
  if (y + 30 >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  var primarySkills = profileData.key_skills;
  doc.text(90, y, 'Primary Skills');
  var skillYPosition = y;
  for (var i = 0; i < primarySkills.length; i++) {
    if (skillYPosition >= 700) {
      skillYPosition = addNewPage();
    }
    doc.setDrawColor(121, 121, 121);
    doc.setFillColor(121, 121, 121);
    doc.rect(90, skillYPosition + 14, 3, 3, 'F');
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(10);
    doc.setFont('Verdana');
    var skill = doc.splitTextToSize(primarySkills[i].title, 200);
    doc.text(105, skillYPosition + 20, skill);
    if (skill.length !== undefined) {
      var linesCount = skill.length;
      skillYPosition = skillYPosition + 10 + 13 * linesCount;
    } else {
      skillYPosition += 15;
    }
  }
  //system access
  if (y >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  var systemAccess = profileData.system_accesses;
  doc.text(320, y, 'System Access');
  var accessYPosition = y;
  for (var i = 0; i < systemAccess.length; i++) {
    if (accessYPosition >= 700) {
      accessYPosition = addNewPage();
    }
    doc.setDrawColor(121, 121, 121);
    doc.setFillColor(121, 121, 121);
    doc.rect(320, accessYPosition + 14, 3, 3, 'F');
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(10);
    doc.setFont('Verdana');
    var access = doc.splitTextToSize(systemAccess[i].title, 180);
    doc.text(335, accessYPosition + 20, access);
    if (access.length !== undefined) {
      var linesCount = access.length;
      accessYPosition = accessYPosition + 10 + 13 * linesCount;
    } else {
      accessYPosition += 15;
    }
  }
  if (skillYPosition >= accessYPosition) {
    y = skillYPosition;
  } else {
    y = accessYPosition;
  }
  if (y >= 700) {
    y = addNewPage();
  }
  //Key Locations

  var keyYPosition = y + 20;
  if (y >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, keyYPosition, 'Key Locations');

  var keyLocations = profileData.key_locations;
  for (var i = 0; i < keyLocations.length; i++) {
    if (keyYPosition >= 700) {
      keyYPosition = addNewPage();
    }
    doc.setDrawColor(121, 121, 121);
    doc.setFillColor(121, 121, 121);
    doc.rect(90, keyYPosition + 14, 3, 3, 'F');
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(10);
    doc.setFont('Verdana');
    var locationText = doc.splitTextToSize(keyLocations[i].location, 200);
    doc.text(105, keyYPosition + 20, locationText);
    if (locationText.length !== undefined) {
      var linesCount = locationText.length;
      keyYPosition = keyYPosition + 10 + 13 * linesCount;
    } else {
      keyYPosition += 15;
    }
  }
  //Overall Perception Rating

  var perceptionRatingYPosition = y + 15;
  if (y >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(320, perceptionRatingYPosition, 'Overall Perception Rating');
  var rating = overallPerceptionRating;
  if (rating === 0) {
    doc.addImage(overallPerceptionRatingIcons1, 'JPEG', 320, perceptionRatingYPosition + 10, 150, 30);
  } else if (rating === 1) {
    doc.addImage(overallPerceptionRatingIcons2, 'JPEG', 320, perceptionRatingYPosition + 10, 150, 30);
  } else if (rating === 2) {
    doc.addImage(overallPerceptionRatingIcons3, 'JPEG', 320, perceptionRatingYPosition + 10, 150, 30);
  } else if (rating === 3) {
    doc.addImage(overallPerceptionRatingIcons4, 'JPEG', 320, perceptionRatingYPosition + 10, 150, 30);
  } else {
    doc.addImage(overallPerceptionRatingIcons5, 'JPEG', 320, perceptionRatingYPosition + 10, 150, 30);
  }
  y = keyYPosition + 25;
  if (y >= 700) {
    y = addNewPage();
  }
  //Work Environment - Key Characteristics
  if (y + 60 >= 700) {
    y = addNewPage();
  }
  var environmentYPosition = y;
  var imageYPosition = y;
  var corporateYPosition = y;
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, environmentYPosition, 'Work Environment - Key Characteristics');
  var workValue = profileData.work_environment;
  var workEnvironment = workValue.replace(/_/g, ' ');
  var environmentValues = ['Home Based', 'Office Based', 'Mobile Working'];

  for (var i = 0; i < environmentValues.length; i++) {
    if (environmentValues[i] === workEnvironment) {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(121, 121, 121);
      doc.circle(95, environmentYPosition + 16, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(110, environmentYPosition + 20, environmentValues[i]);
      environmentYPosition += 25;
    } else {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(255, 255, 255);
      doc.circle(95, environmentYPosition + 16, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(110, environmentYPosition + 20, environmentValues[i]);
      environmentYPosition += 25;
    }
  }
  doc.addImage(busIcon, 'JPEG', 200, imageYPosition + 15, 30, 40);
  doc.addImage(locationIcon, 'JPEG', 250, imageYPosition + 15, 30, 40);

  //Access to Corporate Wifi
  if (y >= 700) {
    y = addNewPage();
  }

  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(320, corporateYPosition, 'Access to Corporate Wifi');
  doc.addImage(wifiIcon, 'JPEG', 330, imageYPosition + 15, 30, 40);
  var corporateWiFi = profileData.access_to_corporate_wifi;
  var corporateValues = ['Yes', 'No'];
  var corporateXPosition = 380;
  for (var i = 0; i < corporateValues.length; i++) {
    if (corporateWiFi === corporateValues[i]) {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(121, 121, 121);
      doc.circle(corporateXPosition, corporateYPosition + 26, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(corporateXPosition + 10, corporateYPosition + 30, corporateValues[i]);
      corporateXPosition += 60;
    } else {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(255, 255, 255);
      doc.circle(corporateXPosition, corporateYPosition + 26, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(corporateXPosition + 10, corporateYPosition + 30, corporateValues[i]);
      corporateXPosition += 60;
    }
  }
  y = environmentYPosition + 20;

  if (y >= 700) {
    y = addNewPage();
  }
  //Digital Confidence
  if (y >= 700) {
    y = addNewPage();
  }
  var confidenceYPosition = y;
  var imageYPosition = y;
  var licenseYPosition = y;
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, confidenceYPosition, 'Digital Confidence');
  doc.setLineWidth(0.5);
  doc.setDrawColor(188, 188, 188);
  doc.line(110, confidenceYPosition + 20, 240, confidenceYPosition + 20);
  doc.setTextColor(121, 121, 121);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, confidenceYPosition + 40, 'Not Confident');
  doc.text(220, confidenceYPosition + 40, 'Confident');
  doc.setDrawColor(121, 121, 121);
  doc.setFillColor(121, 121, 121);
  var confidenceValue = profileData.licence_to_operate_confidence_level;
  if (confidenceValue !== 0) {
    if (confidenceValue <= 50) {
      confidenceValue = 20 + confidenceValue;
    } else {
      confidenceValue = 23 + confidenceValue;
    }
  }
  doc.circle(110 + confidenceValue, confidenceYPosition + 20, 5, 'FD');

  doc.setDrawColor(121, 121, 121);
  doc.line(110, confidenceYPosition + 20, 110 + confidenceValue, confidenceYPosition + 20);

  //License to Operate
  if (y >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(320, licenseYPosition, 'License to Operate');
  doc.addImage(licenseIcon, 'PNG', 330, imageYPosition + 15, 30, 40);
  var licenseValue = profileData.licence_to_operate;
  var licenseValues = ['Yes', 'No'];
  var licenseXPosition = 380;
  for (var i = 0; i < licenseValues.length; i++) {
    if (licenseValue === licenseValues[i]) {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(121, 121, 121);
      doc.circle(licenseXPosition, licenseYPosition + 26, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(licenseXPosition + 10, licenseYPosition + 30, licenseValues[i]);
      licenseXPosition += 60;
    } else {
      doc.setDrawColor(121, 121, 121);
      doc.setFillColor(255, 255, 255);
      doc.circle(licenseXPosition, licenseYPosition + 26, 5, 'FD');
      doc.setTextColor(121, 121, 121);
      doc.setFontSize(10);
      doc.setFont('Verdana');
      doc.text(licenseXPosition + 10, licenseYPosition + 30, licenseValues[i]);
      licenseXPosition += 60;
    }
  }

  //Reporting Lines

  y = confidenceYPosition + 80;
  if (y >= 700) {
    y = addNewPage();
  }
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, y, 'Reporting Lines');
  doc.setTextColor(121, 121, 121);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  doc.text(90, y + 20, 'Reports To:' + profileData.accountableTo);
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  //Key Motivations

  doc.text(320, y, 'Key Motivations');
  doc.setTextColor(188, 188, 188);
  var keyMotivations = profileData.key_motivations;
  var motivationYPosition = y;
  for (var i = 0; i < keyMotivations.length; i++) {
    if (motivationYPosition >= 700) {
      motivationYPosition = addNewPage();
    }
    doc.setDrawColor(121, 121, 121);
    doc.setFillColor(121, 121, 121);
    doc.rect(320, motivationYPosition + 14, 3, 3, 'F');
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(10);
    doc.setFont('Verdana');
    var motivation = doc.splitTextToSize(keyMotivations[i].title, 180);
    doc.text(335, motivationYPosition + 20, motivation);
    if (motivation.length !== undefined) {
      var linesCount = motivation.length;
      motivationYPosition = motivationYPosition + 10 + 13 * linesCount;
    } else {
      motivationYPosition += 15;
    }
  }

  doc.addPage();
  pageCounter++;
  function newPerceptionPage() {
    doc.setFontSize(12);
    doc.setFont('Verdana');
    doc.setTextColor(121, 121, 121);
    doc.text(70, 70, profileData.project.name);
    doc.setTextColor(0, 0, 0);
    doc.setFontSize(18);
    doc.text(500 / 2, 70, Cookies.get('client'));
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(12);
    doc.setFont('Verdana');
    doc.text(465, 70, dateStr);
    doc.addImage(cgIcon, 'JPEG', 70, 760, 270, 70);
    doc.text(515, 780, pageCounter.toString());
    y = 100;
    var pageHeight = 840;
    var secondBoxHeight = pageHeight - y - 100;

    doc.setDrawColor(188, 188, 188);
    doc.rect(70, y, 450, secondBoxHeight);
    y = 125;
    return y;
  }
  y = newPerceptionPage();

  doc.line(70, y + 10, 520, y + 10);
  doc.setTextColor(188, 188, 188);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.setFontType('bold');
  doc.text(100, y, 'General');

  doc.setTextColor(23, 105, 170);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.text(200, y, 'Perception And Opportunities');
  doc.setDrawColor(23, 105, 170);
  doc.setLineWidth(1);
  doc.line(185, y + 10, 380, y + 10);

  doc.setTextColor(188, 188, 188);
  doc.setFontSize(12);
  doc.setFont('Verdana');
  doc.text(390, y, 'Persona Summary');
  //Table
  y = 170;
  function tableHeaders() {
    doc.setDrawColor(188, 188, 188);
    doc.line(70, y, 520, y);
    doc.setTextColor(121, 121, 121);
    doc.setFontSize(12);
    doc.setFont('Verdana');
    doc.text(80, y - 10, 'Process');
    doc.text(170, y - 10, 'Things That Don’t Work For Me');
    doc.text(380, y - 10, 'I Need / Want / Expect');
  }
  tableHeaders();

  y = y + 20;
  var x = 80;
  doc.setTextColor(121, 121, 121);
  doc.setFontSize(10);
  doc.setFont('Verdana');
  for (var i = 0; i < painpointsData.length; i++) {
    var dontWorkYPosition = y;
    var iNeedYPosition = y;
    for (var j = 0; j < painpointsData[i].painpointsThatDontWorkForMe.length; j++) {
      var smileyIcon = getSmiley(painpointsData[i].painpointsThatDontWorkForMe[j].rating);

      doc.addImage(smileyIcon, 'JPEG', x + 80, dontWorkYPosition - 10, 20, 20);
      var dontWorkReason = doc.splitTextToSize(painpointsData[i].painpointsThatDontWorkForMe[j].reason, 160);
      doc.text(x + 105, dontWorkYPosition, dontWorkReason);
      if (dontWorkReason.length !== undefined) {
        var linesCount = dontWorkReason.length;
        dontWorkYPosition = dontWorkYPosition + 10 + 13 * linesCount;
      }
    }
    for (var k = 0; k < painpointsData[i].painpointsINeed.length; k++) {
      var iNeedReason = doc.splitTextToSize(painpointsData[i].painpointsINeed[k].reason, 135);
      doc.text(x + 300, iNeedYPosition, iNeedReason);
      if (iNeedReason.length !== undefined) {
        var linesCount = iNeedReason.length;
        iNeedYPosition = iNeedYPosition + 10 + 13 * linesCount;
      }
    }
    var process = doc.splitTextToSize(painpointsData[i].contract_stage, 60);
    doc.text(80, y, process);
    if (dontWorkYPosition >= iNeedYPosition) {
      y = dontWorkYPosition + 10;
    } else {
      y = iNeedYPosition + 10;
    }
    doc.setDrawColor(188, 188, 188);
    doc.line(70, y - 20, 520, y - 20);
    if (y >= 730) {
      doc.addPage();
      y = newPerceptionPage();
      y += 10;
      tableHeaders();
      y = y + 20;
    }
  }

  doc.save('persona.pdf');
}

export default PdfGenerator;
